import React from "react";
import { Button, ButtonGroup } from "reactstrap";

const Link = props => {
  function handleClick(e) {
    console.log("link was clicked");
  }
  return (
    <Button color="none" className="button-link">
      <a href="https://trello.com/b/zixIPzHN/weekly" onClick={handleClick}>
        <img src={props.image}></img>
        <p>{props.text}</p>
      </a>
    </Button>
  );
};

export default Link;
